div.div:
Ключевое слово else не может использоваться отдельно от if. Приложение во время исполнения заходит в тело else, в случае, если условие в if равно false. else - опциональный блок, его присутствие необзязательно.
Часто можно встретиться конструкцию else if, где после else сразу указывается очередное условие if и осуществляется новая проверка.
Ex. if (a == b) {
std::cout << "a == b";
} else { // если a != b, то программа
// зайдет в этот блок
std::cout << "a != b";
}
Ex. if (a > b) {
std::cout << "a > b";
} else if (a < b) { // здесь else переводит в ветвь,
// где a <= b, но мы указываем
// другое условие
std::cout << "a < b";
else {
std::cout << "a == b";
}
